import React, { Component } from "react";
import * as auth from "../../../api/auth";
import { Route, Redirect } from "react-router-dom";

const ProtectedRoute = ({ props, path, component: Component }, ...all) => {
    if (!auth.getUser) return (props.history.push = "/bazar");

    return <Route path={path} render={(props) => <Component {...all} />} />;
};

export default ProtectedRoute;
